import './App.css';
import DataPart from './components/DataPart.js';
import GHeader from './components/GHeader.js';
import SideBar from './components/SideBar.js';
function App() {
  return (
    <div className="App">
      <GHeader />
      <div className='main-content'>
        <SideBar />
        <DataPart/>
      </div>
    </div>
  );
}

export default App;
